"<h5>h5</h5>\\\")\", :bg-class \"bg-light\"}] nil [:p/html \"<h4>h4</h4><h5>h5</h5>\"]], \"158\" [:div nil nil [:p/markdown \"### hiccup-nocode\\n\\nNotes of kind `:hiccup-nocode` are rendered as Hiccup too, but without showing the code. Here is an example:\"]], \"201\" [:div [:p/code {:code \"(require '[notespace.behavior])\", :bg-class \"bg-light\"}] nil nil], \"141\" [:div nil nil [:p/markdown \"## Note kinds\\n\\nEach note has a kind, that determines its rendering behaviour.\\n\\nOne way to specify a note's kind is by metadata. For example, here is a note of kind `:hiccup`.\"]], \"139\" [:div [:p/code {:code \"^kind/void\\n(comment\\n  (swap! a update :x inc))\", :bg-class \"bg-light\"}] nil nil], \"157\" [:div [:p/code {:code \"^kind/hiccup\\n[:big [:big 3]]\", :bg-class \"bg-light\"}] nil [:big [:big 3]]], \"185\" [:div [:p/code {:code \"^kind/dataset-grid\\n[{:a 1 :b 4}\\n {:a 2 :b 5}\\n {:a 3 :b 6}]\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"175\" [:div nil nil [:p/markdown \"### math\"]], \"155\" [:div nil nil [:p/markdown \"* a\\n* b\\n* c\\n* d\"]], \"202\" [:div [:p/code {:code \"(deftype DummyType1 [data]\\n  notespace.behavior/Behaving\\n  (->behavior [this]\\n    {:render-src? true\\n     :value->hiccup (fn [v] data)}))\", :bg-class \"bg-light\"}] nil nil], \"195\" [:div [:p/code {:code \"(comment\\n  (require '[notespace.cljfx.api :as fx]) \\n\\n  (notespace/update-config #(assoc % :evaluation-callback-fn\\n                             (fn [idx note-count note]\\n                               (let [expected-duration (or  (get-in note [:duration]) 0)]\\n                                 (println 53782496 -0.7872353619413672 -0.10337141392521385 1.1084178225480281 0.0910844757199647 -0.7928380397681414 0.3448742373334226 1.014550014002908 -0.5216374865855582 -0.6040725887413825 0.9495389227675504 0.6286137108725078 -0.9220930075844396 -0.054568841990432215 1.1797598391294084 0.1303288217227641 -0.8980590608468123 0.3319083231227487 1.018676860572588 -0.410805904281213 -0.619889374298529 0.8953504027332312 0.5384284207532896 -0.8668657323378288), :limit 100, :svgWidth 100, :svgHeight 20}]]]], \"192\" [:div [:p/code {:code \"(+ 1 2)\", :bg-class \"bg-light\"}] nil [:p/code {:code \"3\\n\"}]], \"113\" [:div nil nil [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Notespace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]], \"213\" [:div [:p/code {:code \"(future\\n  (Thread/sleep 2000)\\n  (->> #(- (rand) 0.5)\\n       (repeatedly 9)\\n       (reductions +)))\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"(0.287683218850587\\n -0.11433749679733918\\n -0.45154748458049854\\n -0.007228878170456587\\n -0.29579175994569173\\n -0.4980420612565355\\n -0.8351631412137592\\n -0.7892491005690553\\n -0.4488512044624894)\\n\"}]], \"167\" [:div [:p/code {:code \"^kind/vega\\n{\\n  :description \\\"A simple bar chart with embedded data.\\\"\\n  :data {\\n    :values [\\n      {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n      {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n      {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n    ]\\n  }\\n  :mark :bar\\n  :encoding {\\n \\n\"}]], \"212\" [:div nil nil [:p/markdown \"We can ask for a tests summary:\"]], \"145\" [:div [:p/code {:code \"^kind/naive\\n(->> (partial rand-int 6)\\n     (partial repeatedly 6)\\n     (repeatedly 6))\", :bg-class \"bg-light\"}] nil [:p/code {:code \"((0 4 5 0 5 3)\\n (1 1 0 1 1 0)\\n (1 3 3 5 2 2)\\n (0 0 3 5 5 5)\\n (4 5 4 4 3 4)\\n (5 2 1 4 1 3))\\n\"}]], \"128\" [:div nil nil [:p/markdown \"If a note's value is a delay, then you can call `notespace.api/eval-and-realize-note-at-line` or `notespace.api/eval-and-realize-this-notespace` to realize it. Notespace will update its state with the dereferenced value.\\n\\nFor example:\"]], \"199\" [:div [:p/code {:code \"(-> {:description \\\"A simple bar chart with embedded data.\\\"\\n     :data        {:values [\\n                            {:a \\\"A\\\" :b 28} {:a \\\"B\\\" :b 55} {:a \\\"C\\\" :b 43}\\n                            {:a \\\"D\\\" :b 91} {:a \\\"E\\\" :b 81} {:a \\\"F\\\" :b 53}\\n                            {:a \\\"G\\\" :b 19} {:a \\\"H\\\" :b 87} {:a \\\"I\\\" :b 52}\\n                            ]}\\n     :mark        :bar\\n     :encoding    {:x {:field :a :type :nominal :axis {:labelAngle 0}}\\n                   :y {:field :b :type :quantitative}}}\\n    (kind/override kind/vega))\", :bg-class \"bg-light\"}] nil [:p/vega {:description \"A simple bar chart with embedded data.\", :data {:values [{:a \"A\", :b 28} {:a \"B\", :b 55} {:a \"C\", :b 43} {:a \"D\", :b 91} {:a \"E\", :b 81} {:a \"F\", :b 53} {:a \"G\", :b 19} {:a \"H\", :b 87} {:a \"I\", :b 52}]}, :mark :bar, :encoding {:x {:field :a, :type :nominal, :axis {:labelAngle 0}}, :y {:field :b, :type :quantitative}}}]], \"210\" [:div [:p/code {:code \"(require '[midje.sweet :refer [fact]])\", :bg-class \"bg-light\"}] nil nil], \"186\" [:div nil nil [:p/markdown \"--------------------\"]], \"152\" [:div [:p/code {:code \"^kind/md\\n[\\\"##### text:\\\"\\n \\\"* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\\\"]\", :bg-class \"bg-light\"}] nil [:p/markdown \"##### text:\\n* **bold**\\n* *italic*\\n* [link](https://www.youtube.com/watch?v=oIw7E-q-flc)\"]], \"181\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.05170279017055324, \"z\" \\a} {\"x\" 1, \"y\" 0.2980943495232412, \"z\" \\b} {\"x\" 2, \"y\" 0.4774591524000654, \"z\" \\c} {\"x\" 3, \"y\" 0.1462972210770107, \"z\" \\a} {\"x\" 4, \"y\" 0.2525766151356632, \"z\" \\b} {\"x\" 5, \"y\" 0.7456810264113249, \"z\" \\c} {\"x\" 6, \"y\" 0.6121389181173198, \"z\" \\a} {\"x\" 7, \"y\" 0.44647055002737823, \"z\" \\b} {\"x\" 8, \"y\" 0.7628983478420539, \"z\" \\c})}]]], \"184\" [:div nil nil [:p/markdown \"--------------------\"]], \"173\" [:div [:p/code {:code \"^kind/code\\n[\\\"(defn abcd [x] (+ x 9))\\\"\\n \\\"(defn abcd [x] (+ x 3))\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/code \"(defn abcd [x] (+ x 9))\"] [:p/code \"(defn abcd [x] (+ x 3))\"]]], \"190\" [:div nil nil [:p/markdown \"Notes which are forms like `(def ...)` or `(defn ...)` are assigned the kind `:void`.\"]], \"112\" [:div nil nil [:p/markdown \"Notespace renders it so that we see both the code and the evaluation result.\\n\\nAll your namespace is seen as a sequence of toplevel forms, which are considered as notes, and rendered accordingly.\"]], \"148\" [:div [:p/code {:code \"^kind/void\\n(+ 1 2)\", :bg-class \"bg-light\"}] nil nil], \"208\" [:div [:p/code {:code \"^just-code\\n[:div \\\"just some code\\\"]\", :bg-class \"bg-light\"}] nil nil], \"137\" [:div [:p/code {:code \"a\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"{:x 3}\\n\"}]], \"140\" [:div nil nil [:p/markdown \"### Promises\\nComing soon.\"]], \"136\" [:div [:p/code {:code \"(def a\\n  (atom {:x 3}))\", :bg-class \"bg-light\"}] nil nil], \"166\" [:div nil nil [:p/markdown \"The `vega` kind supports both Vega and Vega-Lite visualizations.\"]], \"121\" [:div nil nil [:p/markdown \"### More API functions\\n\\nNotespace offers some more API functions that allow for a dynamic experience with Clojure references.\"]], \"194\" [:div nil nil [:p/markdown \"## Progress logging\\n\\nThis should be documented better soon.\"]], \"168\" [:div nil nil [:p/markdown \"### code\"]], \"154\" [:div nil nil [:p/markdown \"### md-nocode\\n\\nNotes of kind `:md-nocode` are rendered as Markdown too, but without showing the code. Here is an example:\"]], \"209\" [:div nil nil [:p/markdown \"## Midje tests\\n\\nTests of the Midje test framework are rendered as follows:\"]], \"110\" [:div nil nil [:p/markdown \"## Notes\\n\\nHere is a note:\"]], \"174\" [:div [:p/code {:code \"^kind/code\\n(pr-str '(defn abcd [x] (+ x 9)))\", :bg-class \"bg-light\"}] nil [:p/code \"(defn abcd [x] (+ x 9))\"]], \"171\" [:div [:p/code {:code \"^kind/hiccup\\n[:p/code \\\"def abcd(x):\\n  return x+9\\\"\\n {:language :python}]\", :bg-class \"bg-light\"}] nil [:p/code \"def abcd(x):\\n  return x+9\" {:language :python}]], \"130\" [:div nil nil [:p/markdown \"If you have called `notespace.api/eval-and-realize-note-at-line` with the line holding this note, or `notespace.api/eval-and-realize-this-notespace` with this notespace, then you should see the number 3 there. Otherwise, you should see a mark that says it is still pending.\"]], \"200\" [:div nil nil [:p/markdown \"## Inferring note behaviors from types\\nIt is possible to infer a note's behavior from the type of its rendered, overriding the behavior prescribed by its kind. This can be done by extending the `Behaving` protocol.\"]], \"183\" [:div [:p/code {:code \"^kind/dataset-grid\\n{:a [1 2 3]\\n :b [4 5 6]}\", :bg-class \"bg-light\"}] nil [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(showing at most 100 rows)\"]] [:p/dataset {:columnDefs [{:headerName \"a\", :field \"a\"} {:headerName \"b\", :field \"b\"}], :rowData ({\"a\" 1, \"b\" 4} {\"a\" 2, \"b\" 5} {\"a\" 3, \"b\" 6})}]]], \"205\" [:div [:p/code {:code \"(defmethod\\n  ^{:doc\\n    \\\"Example of user extensible kind.\\nNote the ':reload true' in the :require vector:\\n[notespace.kinds :as k :reload true].\\nThis will make REPL testing your extensible kind easier!\\\"}\\n  kind/kind->behaviour ::just-code\\n  [_]\\n  {:render-src?   true\\n   :value->hiccup (constantly nil)})\", :bg-class \"bg-light\"}] nil [:p/code {:code \"#multifn[kind->behaviour 0x57049083]\\n\"}]], \"122\" [:div nil nil [:p/markdown \"#### eval-and-realize-this-notespace\\n\\nUse `notespace.api/eval-and-realize-this-notespace` to evaluate all notes in the current namespace sequentially, one note after another, and then realize them in the background. As always, Notespace is informed about the results.\"]], \"149\" [:div nil nil [:p/markdown \"### hidden\\n\\nA `:hidden` note does not render its value, and also does not show its code.\\n\\nHere is a note that you cannot see:\"]], \"120\" [:div [:p/code {:code \"d2\", :bg-class \"bg-light\"}] [:p {:style {:font-style \"italic\", :font-family \"\\\"Lucida Console\\\", Courier, monospace\"}} [:small \"(dereferenced)\"]] [:p/code {:code \"12\\n\"}]], \"206\" [:div [:p/code {:code \"(def ^{:doc \\\"When making a user extensible kind, you MUST assign the keyword\\nto a variable. Annotating with a keyword WILL NOT WORK!\\\"} just-code ::just-code)\", :bg-class \"bg-light\"}] nil nil], \"144\" [:div nil nil [:p/markdown \"Let us see what kinds of notes we have.\\n\\n### naive\\n\\nA `:naive` note renders its value by pretty-printing it.\"]], \"134\" [:div nil nil [:p/markdown \"### Atoms\"]], \"146\" [:div nil nil [:p/markdown \"This is the default kind, so usually there is no need to mention it.\"]], \"177\" [:div [:p/code {:code \"^kind/math\\n[\\\"(ax ^2 + bx + c = 0 )\\\"\\n \\\"(dx ^2 + ex + f = 0 )\\\"]\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"] [:p/math \"(dx ^2 + ex + f = 0 )\"]]], \"125\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-change\\n\\n Use `notespace.api/eval-and-realize-notes-from-change` to evaluate and realize all notes starting from the line where the file has changed in its last save, compared to the previous save.\"]], \"165\" [:div nil nil [:p/markdown \"### vega\"]], \"153\" [:div [:p/code {:code \"^kind/md\\n(cons\\n \\\"##### numbers:\\\"\\n (for [i (range 1 4)]\\n   (apply str \\\"* \\\" (repeat i i))))\", :bg-class \"bg-light\"}] nil [:p/markdown \"##### numbers:\\n* 1\\n* 22\\n* 333\"]], \"142\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] nil nil], \"211\" [:div [:p/code {:code \"(fact\\n (+ 1 2) => 3)\", :bg-class \"bg-light\"}] nil [:div [:big [:big {:style {:color \"darkgreen\"}} \"✓\"]] \"   true\"]], \"127\" [:div nil nil [:p/markdown \"### Delays\"]], \"109\" [:div nil nil [:p/markdown \"# Notespace v3 intro\\n\\n[Notespace](https://github.com/scicloj/notespace) is a library that turns any Clojure namespace into a 'notespace' -- a namespace with a [notebook](https://en.wikipedia.org/wiki/Notebook_interface) experience. A notespace evolves in an interactive process of exploration, involving a dialogue of your editor, your REPL, your browser and your mind.\\n\\nSo, `Notespace` with a capital `N` is the name of the tool, and `notespace` with a small `n` is the notion that we just presented.\\n\\nHere we describe an experimental incomplete draft of Notespace Version 3.\\n\\nIt is still a bit buggy around handling concurrency, updating efficiently and connecting to the browser. But the current version should be enough to start a community discussion around where we should be taking this.\"]], \"124\" [:div nil nil [:p/markdown \"#### eval-and-realize-notes-from-line\\n\\nUse `notespace.api/eval-and-realize-notes-from-line` to evaluate and realize all notes starting from a certain line, and inform Notespace.\"]], \"138\" [:div nil nil [:p/markdown \"If you evaluated the code in the comment below once, then you should see `{:x 4}`. Otherwise, you should still see `{:x 3}`.\"]], \"114\" [:div nil nil [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]], \"198\" [:div [:p/code {:code \"(-> [\\\"(ax ^2 + bx + c = 0 )\\\"]\\n    (kind/override kind/math))\", :bg-class \"bg-light\"}] nil [:div [:p/math \"(ax ^2 + bx + c = 0 )\"]]], \"147\" [:div nil nil [:p/markdown \"### void\\n\\nA `:void` note does not render its value.\"]], \"151\" [:div nil nil [:p/markdown \"### md\\n\\nNotes of kind `:md` are rendering their values as markdown. More precisely, the value is printed, and the captured printed string is expected to be of Markdown format. If the value is sequential, then its elements are printed and concantenated as lines of one multi-line string, that is then treated as Markdown.\"]], \"182\" [:div nil nil [:p/markdown \"--------------------\"]], \"189\" [:div nil nil [:p/markdown \"Notes which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that
